INSERT INTO `books` VALUES (1,'Война и Мир Книга 1',1,1,4,'2021-01-03','В книгу вошли первый и второй тома романа «Война и мир» – одного из самых знаменитых произведений литературы XIX века.'),(2,'Двадцать тысяч лье под водой',2,2,5,'2021-05-03','Роман «Двадцать тысяч лье под водой» вышел более ста лет назад, но до сих пор он влечет миллионы читателей – любителей необыкновенных путешествий. Жюль Верн увлекает захватывающим сюжетом, неожиданными, подчас опасными приключениями, неведомым миром морских глубин и очаровывает личностью таинственного и загадочного капитана Немо.'),(3,'Дети капитана Гранта',3,2,5,'2021-02-02','Благородный лорд Гленарван и его жена Элен, рассеянный географ Паганель, отважный моряк Джон Манглс, майор Мак-Наббс, дети капитана Гранта – Мэри и Роберт – путешествуют на корабле вокруг света, пересекают Патагонию, Австралию, Новую Зеландию, спасаются от наводнения, сталкиваются с каторжниками, попадают в плен к людоедам, но все-таки находят потерпевшего кораблекрушение Гарри Гранта.'),(4,'Вокруг_света за восемьдесят дней',4,2,5,'2021-01-21','«Вокруг света в восемьдесят дней» – один из лучших романов Жюля Верна. Увлекательная история Филеаса Фогга, его неунывающего слуги Паспарту и их потрясающего воображение кругосветного путешествия, полного опасных приключений, знакома нам с детства – по многочисленным фильмам и мультфильмам. Но насколько они отличаются от произведения самого Жюля Верна?Читателям только предстоит понять это, открыв для себя эту великолепную книгу…'),(5,'Евгений Онегин',5,4,4,'2021-04-07','«Читали ли вы „Онегина“? Каков вам кажется „Онегин“? Что вы скажете об „Онегине“? Вот вопросы, повторяемые беспрестанно в кругу литераторов и русских читателей», – отмечал после выхода в свет второй главы романа писатель, предприимчивый издатель и, кстати, герой многочисленных эпиграмм Пушкина Фаддей Булгарин. Уже давно «Евгения Онегина» не принято оценивать. Говоря словами того же Булгарина, он «написан стихами Пушкина. Этого довольно». Зато иллюстраторы до сих пор радуют читателей разными художественными интерпретациями романа в стихах. Один из первых циклов рисунков к «Евгению Онегину» создал Павел Соколов, которого современники называли «творцом Татьяны». А через полвека огромной популярностью пользовалось великолепное издание одной из лучших российских типографий – «Товарищества Р. Голике и А. Вильборг», поставщика Императорского двора, с акварелями Елены Самокиш-Судковской.'),(6,'Гробовщик',6,4,4,'2021-03-12','Гробовщик Адриан Прохоров был угрюм и задумчив, то есть нрав его совершенно соответствовал его мрачному ремеслу. Однажды его сосед пригласил гробовщика к себе в гости…'),(7,'Война и мир книга 2',7,1,4,'2021-04-07','В книгу вошли третий и четвертый тома романа «Война и мир» – одного из самых знаменитых произведений литературы XIX века.'),(8,'Робинзон Крузо',8,5,5,'2021-03-23','История жизни Робинзона на необитаемом острове – повествование о мужественном и находчивом человеке, который сумел выжить и не одичать благодаря своему сильному духу и трудолюбию.'),(9,'Риторика',9,6,2,'2021-01-29','«Риторика» Аристотеля – это труд, который рассматривает роль речи как важного инструмента общественного взаимодействия и государственного устроения. Речь как способ разрешения противоречий, достижения соглашений и изменения общественного мнения.Этот труд, без преувеличения, является основой и началом для всех работ по теории и практике искусства убеждения, полемики, управления путем вербального общения.В трех книгах «Риторики» есть все основные теоретические и практические составляющие успешного выступления.Трактат не утратил актуальности. Сегодня он вполне может и даже должен быть изучен теми, кому искусство убеждения, наука общения и способы ясного изложения своих мыслей необходимы в жизни.'),(10,'Политика',10,6,2,'2021-05-18','«Средний класс», «экономика», «семья как ячейка государства», «политика», «конституция», «гражданский долг» – мы произносим эти слова и выражения, даже не зная, что самим их существованием обязаны Аристотелю, гениальному мыслителю, который впервые ввел их в оборот в своем произведении «Политика», где и изобрел социальную и политическую философию, впервые в истории выделив изучение общественных отношений в самостоятельную науку.«Человек по природе своей существо политическое», – говорил Аристотель. Но какое политическое устройство он полагал справедливым? На какие социальные слои предлагал опираться, чтобы наилучшим образом организовать совместную жизнь в государстве? И в чем видел залог правильного и разумного государственного управления?'),(11,'Капитал. Том первый',11,7,2,'2021-03-22','Отношение к Карлу Марксу всегда вызывало острейшие споры. Именно его идеи оказали огромное влияние на формирование и понимание современного мира. Долгие десятилетия советские догмы были единственно возможным и допустимым толкованием марксизма. Настало ли время нового общественного интереса к Карлу Марксу? Будут ли и впредь волновать людей те теории, с которыми он вошел в историю? Станет ли Маркс более читаемым и безотчетно превозносимым или будет предан забвению и с порога отвергнут? Об этом размышляют во вступительной статье философ и экономист, полагающие, что для ответа на эти и многие другие вопросы следует читать Маркса. Вниманию читателей предлагается первый том главного труда жизни К. Маркса «Капитал».'),(12,'Капитал. Том второй',12,7,2,'2021-02-17','Отношение к Карлу Марксу всегда вызывало острейшие споры. Именно его идеи оказали огромное влияние на формирование и понимание современного мира. Долгие десятилетия советские догмы были единственно возможным и допустимым толкованием марксизма. Настало ли время нового общественного интереса к Карлу Марксу? Будут ли и впредь волновать людей те теории, с которыми он вошел в историю? Станет ли Маркс более читаемым и безотчетно превозносимым или будет предан забвению и с порога отвергнут? Об этом размышляют во вступительной статье философ и экономист, полагающие, что для ответа на эти и многие другие вопросы следует читать Маркса. Вниманию читателей предлагается второй том главного труда жизни К. Маркса «Капитал»'),(13,'Десять негритят',13,8,3,'2021-04-25','Десять никак не связанных между собой людей в особняке на уединенном острове… Кто вызвал их сюда таинственным приглашением? Зачем кто-то убивает их, одного за другим, самыми невероятными способами? Почему все происходящее так тесно переплетено с веселым детским стишком?Роман «Десять негритят» – один из величайших детективных произведений в истории. Выпущенный общим тиражом более 100 000 000 экземпляров, он занимает пятое место в списке бестселлеров художественной литературы всех времен – и безусловное первое место среди романов самой Агаты Кристи.Агата Кристи – самый публикуемый автор всех времен и народов после Шекспира. Тиражи ее книг уступают только тиражам его произведений и Библии. В мире продано больше миллиарда книг Кристи на английском языке и столько же – на других языках. Она автор восьмидесяти детективных романов и сборников рассказов, двадцати пьес, двух книг воспоминаний и шести психологических романов, написанных под псевдонимом Мэри Уэстмакотт. Ее персонажи Эркюль Пуаро и мисс Марпл навсегда стали образцовыми героями остросюжетного жанра.«Шедевр Агаты Кристи».Spectator«Величайшее достижение грандиозной писательской карьеры»'),(14,'Немезида',14,8,3,'2021-04-26','Мисс Марпл получила известие с того света – письмо от старого друга, мистера Рэфьела, известного читателям по роману «Карибская тайна». В своем завещании богач просит мисс Марпл раскрыть жестокое преступление. Хотя оно и было совершено много лет назад, знаменитая леди сыщик смело берется за дело…'),(15,'Лунный камень',15,9,3,'2021-03-06','Английский писатель Уилки Коллинз – один из создателей детективного жанра. «Лунный камень» – самое знаменитое произведение Коллинза, лучший детективный роман в английской литературе.В день своего совершеннолетия Рэйчел Вериндер, согласно завещанию дяди, получает в дар огромный алмаз редкой красоты. Никто не подозревает, что этот камень – предмет религиозного культа, похищенный из индийского храма. По древнему преданию, алмаз приносит несчастье всякому незаконному владельцу, в чьих руках оказывается. На следующее утро камень таинственным образом исчезает из спальни Рэйчел, и тяжкие подозрения падают на близких ей людей и на нее саму.'),(16,'Трудно быть богом',16,10,1,'2021-01-22','«Трудно быть богом». Наверное, самый прославленный из романов братьев Стругацких.История землянина, ставшего «наблюдателем» на планете, застрявшей в эпохе позднего средневековья, и принужденного «не вмешиваться» в происходящее, экранизирована уже несколько раз – однако даже лучший фильм не в силах передать всего таланта книги, на основе которой он снят!..'),(19,'Страна багровых туч',17,10,1,'2021-05-01','Научно – фантастическая повесть «Страна багровых туч» рассказывает о тяжелой и опасной, полной драматических событий экспедиции на Венеру, одну из самых малодоступных планет солнечной системы.В конце XX века, в разгар великого завоевания человеком околосолнечного пространства, на Венере обнаружено необычайно богатое месторождение радиоактивных руд – «Урановская Голконда». Для штурма Венеры советские конструкторы создают межпланетный корабль нового типа – фотонную ракету «Хиус». Разведка таинственной «Урановой Голконды» и устройство на ее берегах первого ракетодрома поручено отборной шестерке отважных межпланетников.'),(20,'Карантин',18,11,1,'2021-03-19','«Сад ослепительно сверкал, осыпанный весь, с корней до верхушек, прозрачным благоуханным снегом. Зеленое озеро нежной, молодой травы стояло внизу, пронизанное горячим блеском, пламеневшим в голубой вышине. Свет этот, подобно дождевому ливню, катился сверху, заливая прозрачный, яблочный снег, падая на его кудрявые очертания, как золотистый шелк на тело красавицы. Розоватые, белые лепестки, не выдерживая горячей, золотой тяжести, медленно отделяясь от чашечек, плыли вниз, грациозно кружась в хрустальной зыби воздуха. Они падали и реяли, как мотыльки, бесшумно пестря белыми точками нежную, тихую траву…»'),(21,'Вишневый сад',19,3,4,'2021-01-14','«Комната, которая до сих пор называется детскою. Одна из дверей ведет в комнату Ани. Рассвет, скоро взойдет солнце. Уже май, цветут вишневые деревья, но в саду холодно, утренник. Окна в комнате закрыты.Входят Дуняша со свечой и Лопахин с книгой в руке…»'),(23,'Палата № 6',20,3,4,'2021-04-11','«Палата №6» – история доктора, который сам становится пациентом. Опыт работы земским врачом позволил писателю предельно достоверно описать быт больницы, взаимоотношения врачей и больных. Рассказ проникнут горькой иронией и ощущением безнадежности, но, возможно, именно бессилие чеховских героев заставит кого-то впервые в жизни совершить Поступок – чтобы доказать самому себе, что он-то не находится в этой палате.'),(24,'Убийство на улице Морг',21,12,3,'2021-04-03','«Убийство на улице Морг» – рассказ известного американского новеллиста и автора рассказов в стиле хоррор Эдгара Аллана По (англ. Edgar Allan Poe, 1809-1849). ***Полиция Парижа в недоумении: кому понадобилось жестокое убийство на улице Морг? На помощь приходит сам Огюст Дюпен, чей невероятный нюх хорошо известен стражам порядка.Автор также знаменит благодаря произведениям «Спуск в Мальштрем», «Падение дома Эшер», «Свидание», «Тень», «Четыре зверя в одном», «Остров феи», «Поместье Арнгейм» и «Золотой жук».Эдгара Аллана По считают одним из самых ярких представителей американского романтизма. Создатель современной формы мистического детектива, он завоевал признание читателей готической атмосферностью и психологизмом своих произведений.'),(25,'Капитанская дочка',22,4,4,'2021-03-19','В романе «Капитанская дочка» А.С.Пушкин нарисовал яркую картину стихийного крестьянского восстания под предводительством Емельяна Пугачева.');
